import { createContext } from "react";

import {
  ItemCompanyProps,
  ListGuestProps,
  ListEventsProps,
} from "../../@types";

interface InfoProps {
  timeNow: string;
  setTimeNow: (c: string) => void;
  allEvents: ListEventsProps[];
  setAllEvents: (c: ListEventsProps[]) => void;
  selectedEvent: string;
  setSelectedEvent: (c: string) => void;
  search: string;
  setSearch: (c: string) => void;
  totalGuests: number;
  // setTotalGuests: (c: number) => void;
  guests: ListGuestProps[];
  setGuests: (c: ListGuestProps[]) => void;
  perPage: number;
  setPerPage: (c: number) => void;
  skip: number;
  setSkip: (c: number) => void;
  byEvent: string;
  setByEvent: (c: string) => void;
}

export const InfoContext = createContext<InfoProps>({
  timeNow: "",
  setTimeNow: () => {},
  allEvents: [],
  setAllEvents: () => {},
  selectedEvent: "",
  setSelectedEvent: () => {},
  search: "",
  setSearch: () => {},
  totalGuests: 0,
  // setTotalGuests: () => {},
  guests: [],
  setGuests: () => {},
  perPage: 5,
  setPerPage: () => {},
  skip: 0,
  setSkip: () => {},
  byEvent: "",
  setByEvent: () => {},
});
